const AddGame = (props) => {
    const { addGame, handleGameSubmit } = props
        return (
            <div>
                <form onSubmit={handleGameSubmit}>
                    <input placeholder="URL" type="text" onChange={e => handleGameSubmit(e)} />
                    <input placeholder="Game Name" type="text" onChange={e => handleGameSubmit(e)} />
                    <input placeholder="Description" type="textarea"  onChange={e => handleGameSubmit(e)} />
                    <input placeholder="Price" type="text"onChange={e => handleGameSubmit(e)} />
                    <button type='submit'>Submit</button>
                </form>
            </div>
        )
}

export default AddGame;
